"use strict";(self.webpackChunkdev_shipperhq=self.webpackChunkdev_shipperhq||[]).push([[920],{3908:e=>{e.exports=JSON.parse('{"name":"guide","permalink":"/docs/tags/guide","docs":[{"id":"insights/examples","title":"Examples","description":"Since the Insights API is implemented in GraphQL, you can retrieve as much information as you want or as little as you need. Below you\'ll find examples of both simple and more advanced Insights API requests and their associated responses.","permalink":"/docs/insights/examples"},{"id":"labels/examples","title":"Examples","description":"Below you\'ll find a number of examples covering various uses cases for the Labels API. You\'ll also find a Postman collection that can be downloaded.","permalink":"/docs/labels/examples"},{"id":"rates/examples","title":"Examples","description":"Below you\'ll find a number of examples covering various uses cases for the Rates API. You\'ll also find a Postman collection that can be downloaded.","permalink":"/docs/rates/examples"},{"id":"insights/faq","title":"FAQ","description":"Is the data for past orders available via the Insights API?","permalink":"/docs/insights/faq"},{"id":"labels/faq","title":"FAQ","description":"Is the Labels API available?","permalink":"/docs/labels/faq"},{"id":"rates/faq","title":"FAQ","description":"Does the rating API return duties (DDU/DDP) information?","permalink":"/docs/rates/faq"},{"id":"insights/how-insights-work","title":"How Insights Work","description":"ShipperHQ generates a significant amount of detail about each shipment for which it generates shipping rates and options each time an application calls the Rates API. Once the ShipperHQ account associated with the rating call has the Shipping Insights Advanced Feature enabled, ShipperHQ stores these shipment details for later retrieval with the Insights API.","permalink":"/docs/insights/how-insights-work"},{"id":"labels/how-labels-work","title":"How Labels Work","description":"The ShipperHQ Labels API can be used to produce shipping labels but it is much more powerful when combined with the ShipperHQ Rates API and Insights API. At a minimum, the Insights API must be implemented in order to support storing shipment information used to produce labels.","permalink":"/docs/labels/how-labels-work"},{"id":"rates/how-rates-work","title":"How Rates Work","description":"High-level overview","permalink":"/docs/rates/how-rates-work"},{"id":"insights/overview","title":"Overview","description":"Many elements impact both the shipping rates and shipping options offered to customers. Once selected, these options determine how to fulfill these orders. For example, what carrier and service to use, what package or packages to use, what warehouse to ship from, when to dispatch the shipment, etc. When ShipperHQ is used to produce shipping rates and options, it will determine many of these elements as part of its rating calculations. The Insights API gives you access to all of those details so that you can integrate them into your application.","permalink":"/docs/insights/overview"},{"id":"labels/overview","title":"Overview","description":"The Labels API enables you to produce shipping labels for shipments directly within your application. When used in conjunction with the ShipperHQ Rates API and Insights API it provides an end-to-end solution from checkout to fulfillment.","permalink":"/docs/labels/overview"},{"id":"rates/overview","title":"Overview","description":"What are rates?","permalink":"/docs/rates/overview"},{"id":"labels/place-order","title":"PlaceOrder Mutation","description":"How Rating + Shipping Insights Work with PlaceOrder","permalink":"/docs/labels/place-order"},{"id":"insights/quickstart","title":"Quickstart","description":"This document is for technical architects and developers that need to integrate with ShipperHQ\u2019s Insights API to build their own integration to retrieve shipment details from ShipperHQ.","permalink":"/docs/insights/quickstart"},{"id":"labels/quickstart","title":"Quickstart","description":"This document is for technical architects and developers that need to integrate with ShipperHQ\u2019s Labels API to build their own integration to generate and print shipping labels.","permalink":"/docs/labels/quickstart"},{"id":"rates/quickstart","title":"Quickstart","description":"This document is for technical architects and developers that need to integrate with ShipperHQ\u2019s Rates API to build their own integration to retrieve shipment details from ShipperHQ.","permalink":"/docs/rates/quickstart"}],"allTagsPath":"/docs/tags"}')}}]);